import React from 'react';

const Skills = () => {
  return (
    <section className="skills">
      <h1>My Skills</h1>
      <ul>
        <li>HTML & CSS</li>
        <li>JavaScript</li>
        <li>React</li>
        <li>SQL And DB Management</li>
        <li>Kotlin</li>
        <li>Figma</li>
        {/* Add more skills as needed */}
      </ul>
    </section>
  );
};

export default Skills;
